import React from 'react';
import './index.css';
import Flowers from './Components/Flowers';
import FlowersData from './Components/FlowersData';

const App = () => {
  return (
    <>
      <h1>About Flowers</h1>
      <div className="container">

        {FlowersData.map((values) => {
          return (
            <>
              <Flowers
                title={values.title}
                imgsrc={values.imgsrc}
                text={values.text}
                btn={values.btn}
              />
            </>
          )
        })}

      </div>
    </>
  )
}
export default App;
